from collections import Counter

def getFolderNames(names):
    seen, res = Counter(), []
    for name in names:
        if name in seen:
            while True:
                c = f'({seen[name]})'
                if name + c not in seen:
                    name += c
                    break
                else:
                    seen[name] += 1
        seen[name] += 1
        res.append(name)
    return res

import sys 

def MatrixChainOrder(p, i, j): 

    if i == j: 
        return 0

    _min = sys.maxsize 

    for k in range(i, j): 

        count = (MatrixChainOrder(p, i, k)  
             + MatrixChainOrder(p, k + 1, j) 
                   + p[i-1] * p[k] * p[j]) 

        if count < _min: 
            _min = count; 


    return _min; 

