    else: 
        mid = n//2

    start1 = 0
    start2 = mid 

    while(start1 < mid and start2 < n): 

        if (a[start1]== a[start2]): 
            start1 = start1 + 1
            start2 = start2 + 1
        else: 
            flag = 1
