def UncommonWords(str1, str2): 

    count = {} 

    for word in str1.split(): 
        count[word] = count.get(word, 0) + 1

    for word in str2.split(): 
        count[word] = count.get(word, 0) + 1

    return [word for word in count if count[word] == 1]

def commonWords(str1, str2): 

    count = {} 

    for word in str1.split(): 
        count[word] = count.get(word, 0) + 1

    for word in str2.split(): 
        count[word] = count.get(word, 0) + 1

    return [word for word in count if count[word] > 1]

